  false,\n\t\"url\": null,\n\t\"notes\": \"Zooplankton, nutrients, and other data
  were collected from bottle and net casts in the South Pacific and Equatorial Pacific
  Oceans from the CORIOLIS from 05 April 1981 to 16 August 1981. Zooplankton data
  include taxonomic identifications, total wet weights, and settled volumes. Nutrient
  data include concentration profiles of oxygen, phosphate, nitrate, nitrite, silicate
  and chlorophyll a. Data also include temperatures and salinity profiles. Data are
  comma-delimited ascii text in a comma-separated value (.csv) format.\",\n\t\"license_title\":
